import snapshotEquals from './snapshotEquals.js';
QUnit.module('PixelComparison');
const DEFAULT_THRESHOLD = 1.5;
function snapshotFromImage(image) {
  const canvas = document.createElement('canvas');
  canvas.width = image.width;
  canvas.height = image.height;
  const context = canvas.getContext('2d');
  context.drawImage(image, 0, 0, image.width, image.height);
  return context.getImageData(0, 0, image.width, image.height);
}
const testedRenderers = ['canvas', 'svg', 'dom', 'webgl'];
const layoutTestedRenderers = ['svg'];
const colors = [new Color(62, 171, 3), new Color(23, 180, 77), new Color(24, 183, 138), new Color(23, 178, 194), new Color(20, 163, 238), new Color(71, 136, 255), new Color(171, 101, 255), new Color(228, 72, 235), new Color(252, 66, 186), new Color(252, 82, 127)];

